import './App.css';
import ContentContainer from '../organisms/ContentContainer';
import Navbar from '../organisms/Navbar';

function App() {

  const style = {
    width: "100%",
    height: "883px",
    background: "linear-gradient(-135deg, #E4A972, #9941D8)"
  }

  return (
    <div className="App">
        <Navbar />
        <ContentContainer />
    </div>
  );
}

export default App;
